import React, {use} from 'react'

const GuestList = props => {
    const {guests} = props

    return(
        <div className='guestlist'>
            <p>Guests</p>
            {guests && guests.map(guest => {
                return (
                    <h5>{guest}</h5>
                )
            })}
        </div>
    )
}

export default GuestList;
